import React from 'react';

import { type Props, defaultProps, propTypes } from './common-types';
import BpkButtonBase, { cssModules } from './BpkButtonBase';
import STYLES from './BpkButtonDestructive.scss';

const getClassName = cssModules(STYLES);

const BpkButtonDestructive = (props: Props) => {
  const { className, ...rest } = props;

  const classNames = [getClassName('bpk-button--destructive')];

  if (className) {
    classNames.push(className);
  }
  const classNamesFinal = classNames.join(' ');

  return (
    // $FlowFixMe - inexact rest. See 'decisions/flowfixme.md'.
    <BpkButtonBase className={classNamesFinal} {...rest} />
  );
};

BpkButtonDestructive.propTypes = { ...propTypes };
BpkButtonDestructive.defaultProps = { ...defaultProps };

export default BpkButtonDestructive;
